Tower Prep is an American-Canadian television series that premiered on Cartoon Network in October 16, 2010, after the world premiere of Scooby-Doo! Curse of the Lake Monster. The series is created by Paul Dini, a former producer and writer of the DC animated universe.
Tower Prep is Cartoon Network's second one-hour live-action series after Unnatural History.

